export default function OkBtn() {
  return (
    <div className="flex flex-col mt-4 w-full text-neutral-100">
      <button
        type="submit"
        className="gap-2.5 self-stretch px-5 py-3.5 w-full rounded-lg bg-neutral-600 min-h-[44px]"
      >
        Yeah, thanks!
      </button>
    </div>
  );
}
